<!DOCTYPE html>
<html lang="ko">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>SND Labs 2026 새해 인사장 - 말의 해</title>
    <style>
        @import url('https://fonts.googleapis.com/css2?family=Noto+Sans+KR:wght@300;400;700;900&family=Playfair+Display:wght@700&display=swap');
        
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }
        
        body {
            font-family: 'Noto Sans KR', sans-serif;
            background: linear-gradient(135deg, #1a1a2e 0%, #16213e 100%);
            display: flex;
            justify-content: center;
            align-items: center;
            min-height: 100vh;
            padding: 20px;
        }
        
        .card-container {
            max-width: 1400px;
            width: 100%;
            background: white;
            border-radius: 24px;
            box-shadow: 0 30px 80px rgba(0, 0, 0, 0.4);
            overflow: hidden;
            animation: slideIn 0.8s ease-out;
        }
        
        @keyframes slideIn {
            from {
                opacity: 0;
                transform: translateY(40px);
            }
            to {
                opacity: 1;
                transform: translateY(0);
            }
        }
        
        .card-content {
            display: grid;
            grid-template-columns: 55% 45%;
            gap: 0;
        }
        
        .image-section {
            background: linear-gradient(135deg, #ffd89b 0%, #19547b 100%);
            display: flex;
            align-items: center;
            justify-content: center;
            min-height: 700px;
            padding: 40px;
        }
        
        .image-section img {
            width: 100%;
            height: 100%;
            object-fit: cover;
            border-radius: 20px;
        }
        
        .text-section {
            padding: 70px 60px;
            display: flex;
            flex-direction: column;
            justify-content: center;
            background: linear-gradient(180deg, #ffffff 0%, #f5f7fa 100%);
        }
        
        .year-badge {
            display: inline-block;
            background: linear-gradient(135deg, #d4af37 0%, #f4e5a6 100%);
            color: #1a1a2e;
            padding: 8px 16px;
            border-radius: 25px;
            font-size: 12px;
            font-weight: 700;
            margin-bottom: 20px;
            text-transform: uppercase;
            letter-spacing: 1px;
            width: fit-content;
        }
        
        .title {
            font-size: 38px;
            font-weight: 900;
            color: #1a1a2e;
            margin-bottom: 35px;
            line-height: 1.3;
            letter-spacing: -0.5px;
        }
        
        .title-highlight {
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            -webkit-background-clip: text;
            -webkit-text-fill-color: transparent;
            background-clip: text;
        }
        
        .greeting {
            font-size: 16px;
            line-height: 1.8;
            color: #4a5568;
            margin-bottom: 25px;
            font-weight: 500;
        }
        
        .message {
            font-size: 15px;
            line-height: 1.85;
            color: #5a6c7d;
            margin: 18px 0;
            font-weight: 300;
        }
        
        .message:first-of-type {
            margin-top: 20px;
        }
        
        .closing {
            font-size: 20px;
            font-weight: 900;
            color: #1a1a2e;
            margin-top: 35px;
            padding-top: 25px;
            border-top: 2px solid #e8ebf0;
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            -webkit-background-clip: text;
            -webkit-text-fill-color: transparent;
            background-clip: text;
            letter-spacing: 0.5px;
        }
        
        .footer {
            font-size: 13px;
            color: #cbd5e0;
            margin-top: 35px;
            text-align: right;
            font-weight: 500;
        }
        
        @media (max-width: 1024px) {
            .card-content {
                grid-template-columns: 1fr;
            }
            
            .image-section {
                min-height: 400px;
            }
            
            .text-section {
                padding: 50px 40px;
            }
            
            .title {
                font-size: 32px;
            }
        }
        
        @media (max-width: 640px) {
            .image-section {
                min-height: 300px;
                padding: 20px;
            }
            
            .text-section {
                padding: 30px 25px;
            }
            
            .title {
                font-size: 24px;
                margin-bottom: 25px;
            }
            
            .greeting {
                font-size: 14px;
            }
            
            .message {
                font-size: 13px;
                line-height: 1.8;
            }
            
            .closing {
                font-size: 16px;
            }
        }
    </style>
</head>
